**Transcribe Audio File:**
```javascript
async function transcribe_audio_file(
  audioFilePath,
  language='en',
  prompt=null,
  temperature=0
) {
  // 1. Validate file size (25MB max for OpenAI)
  const stats = fs.statSync(audioFilePath)
  const fileSize = stats.size

  if (fileSize > 25 * 1024 * 1024) {
    throw new Error('Audio file is too large.')
  }

  // 2. Create form data
  const formData = new FormData()
  const audioStream = fs.createReadStream(audioFilePath)

  formData.append('file', audioStream)
  formData.append('model', 'whisper-1')
  formData.append('language', language)
  formData.append('response_format', 'verbose_json')
  formData.append('temperature', temperature)

  if (prompt != null) {
    formData.append('prompt', prompt)
  }

  // 3. Submit with retry mechanism
  const result = await retryFormDataSubmit(
    formData,
    WHISPER_OPTIONS,
    retries=3,
    delay=1000,
    timeout=600000
  )

  return result
}
```

**Retry Mechanism:**
```javascript
const retryFormDataSubmit = (
  formData,
  options={},
  retries=3,
  delay=1000,
  timeout
) => {
  return new Promise((resolve, reject) => {
    const attempt = (retriesLeft) => {
      formData.submit(options, (error, response) => {
        if (error) {
          if (retriesLeft > 0) {
            attempt(--retriesLeft)
          } else {
            reject(error)
          }
        } else {
          // Handle response
          resolve(response)
        }
      })
    }
    attempt(retries)
  })
}
```

