  // 4. Export as project
  const filename = newSequenceName + '.prproj'
  eval_string = `app.project.activeSequence.exportAsProject("${filename}")`
  await jsxExecute(eval_string)

  // 5. Restore original name
  eval_string = `app.project.activeSequence.name = "${currentName}"`
  await jsxExecute(eval_string)

  // 6. Import duplicated project
  eval_string = `app.project.importFiles("${filename}", 1, app.project.rootItem, 0)`
  await jsxExecute(eval_string)

  return {new_sequence_id, new_sequence_name}
}
