  await jsxExecute(`app.project.importFiles("${undoPath.toCEP()}", 1, app.project.rootItem, 0)`)

  // 3. Find imported sequence
  const importedSequenceName = g_undo_state_json.name + g_undo_state_json.random_string
  const importedSequenceID = await jsxExecute(`findSequenceIDByName("${importedSequenceName}")`)

  // 4. Rename current sequence to "old"
  await jsxExecute(`app.project.activeSequence.name = app.project.activeSequence.name + " - old - " + new Date().toLocaleString()`)

  // 5. Move old sequence to bin (optional)
  if (moveToBin) {
    await jsxExecute('app.project.activeSequence.projectItem.moveBin(getEditAIBin())')
  }

  // 6. Close current and open imported sequence
  await jsxExecute('app.project.activeSequence.close()')
  await jsxExecute(`app.project.openSequence("${importedSequenceID}")`)

  // 7. Restore original name
  await jsxExecute(`app.project.activeSequence.name = "${g_undo_state_json.name}"`)

  // 8. Cleanup
  fs.unlinkSync(path.join(DIR_app_data_base, 'undo_state.json'))
  g_undo_state_json = {}
}
